for(var i = 0 ; i < orderDetails.getLength() ; i++){
    if(orderDetails.getRow(i).ART_DESCRIPTION == "INSTALLATION" || orderDetails.getRow(i).ART_DESCRIPTION == "MAINTENANCE"){
    	orderStocks.AddRow({ART_ID : orderDetails.getRow(i).ART_ID,
                       ART_DESCRIPTION : orderDetails.getRow(i).ART_DESCRIPTION,
                       ART_STOCK : artStock.ART_STOCK,
                       STATUS: "IN STOCK"});
    } else {
    	var params = {
        articleDescription: orderDetails.getRow(i).ART_DESCRIPTION /* STRING */
    	};
        var artStock = me.getStockForArticle(params);

        if(artStock.ART_STOCK >= orderDetails.getRow(i).QUANTITY){
            orderStocks.AddRow({ART_ID : orderDetails.getRow(i).ART_ID,
                           ART_DESCRIPTION : orderDetails.getRow(i).ART_DESCRIPTION,
                           ART_STOCK : artStock.ART_STOCK,
                           STATUS: "IN STOCK"});
            var params = {
                orderDetID: orderDetails.getRow(i).ORDERDET_ID /* INTEGER */,
                status: "AVAILABLE" /* STRING */
            };
            me.updateOrderDetailStatus(params);
        } else {
            orderStocks.AddRow({ART_ID : orderDetails.getRow(i).ART_ID,
                           ART_DESCRIPTION : orderDetails.getRow(i).ART_DESCRIPTION,
                           ART_STOCK : artStock.ART_STOCK,
                           STATUS: "NOT ENOUGH STOCK"});
            var params = {
                orderDetID: orderDetails.getRow(i).ORDERDET_ID /* INTEGER */,
                status: "NOT AVAILABLE" /* STRING */
            };
            me.updateOrderDetailStatus(params);
        }
    }    

}

